function calculateCombination(&$retval = [], $combos, $qtty, $minAmount = PHP_INT_MAX)
{
    $result = [];
    $remainingQtty = $qtty;
    foreach ($combos as $comboItems => $comboPrice) {
        $comboItemsQtty = (int) ($remainingQtty / $comboItems);
        if ($comboItemsQtty == 0) {
            continue;
        }
        $result["combos"][$comboItems] = $comboItemsQtty;        
        $result["amount"] += $result["combos"][$comboItems] * $comboPrice;
        $remainingQtty = $remainingQtty % $comboItems;
    }
    if ($result["amount"] < $minAmount) {
        $minAmount = $result["amount"];
        $retval = $result;
    }
    if (count($combos) > 1) {
        unset($combos[key($combos)]);
        calculateCombination($retval, $combos, $qtty, $minAmount);
    } else {
        return $retval;
    }
}

$combos = [
    3 => 220,
    2 => 150,
    1 => 90
];
calculateCombination($result, $combos, 10);
var_dump($result);
```

```javascript
function calculateCombination(combos, qtty, minAmount, retval) {
    var result = {
        combos: [],
        amount: 0
    };
    var remainingQtty = qtty;
    minAmount = minAmount == null ? Number.MAX_VALUE : minAmount;
    for (let index = 0; index < combos.length; index++) {
        const comboItems = combos[index]["items"];
        const comboPrice = combos[index]["price"];
        var comboItemsQtty = parseInt(remainingQtty / comboItems);
        if (comboItemsQtty == 0) {
            continue;
        }
        result["combos"].push({
            "items": comboItems,
            "qtty": comboItemsQtty
        });
        result["amount"] += comboItemsQtty * comboPrice;

        remainingQtty = remainingQtty % comboItems;
    }
    if (result["amount"] < minAmount) {
        minAmount = result["amount"];
        retval = result;
    }
    if (combos.length > 1) {
        var clonedCombos = [...combos];
        clonedCombos.shift();
        retval = calculateCombination(clonedCombos, qtty, minAmount, retval);
    }
    return retval;
}
var result = calculateCombination([
    {
        "items": 3,
        "price": 220
    },
    {
        "items": 2,
        "price": 150
    },
    {
        "items": 1,
        "price": 90
    }
], 4);


